const MenuItem = ({
  className, 
  item, 
  isBurgerActive,
  onSectionToScroll
}) => {
  return (
    <li className={`${className}__item`}>
      <button
        onClick={onSectionToScroll}
      >
        <span>{item.data}</span>
      </button>
    </li>
  )
}

export default MenuItem
